import React from 'react';
import { Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const NewProject = () => {
    const navigate = useNavigate();

    const handleBack = () => {
        navigate("/projects");
    };

    return (
        <div>
            <h1>Create a New Project</h1>
            {/* Adaugă aici formularul sau conținutul pentru crearea unui proiect nou */}
            <Button
                variant="contained"
                style={{ backgroundColor: "#ff6347", padding: "10px" }}
                onClick={handleBack}
            >
                Back to Projects
            </Button>
        </div>
    );
};

export default NewProject;
